  \"swfsc-mmtd-etp-population-of-delphinus-stocks-pods-1992\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"The National Marine Fisheries Service (NMFS) was mandated
  by the 1984 amendment to the Marine Mammal Protection Act to monitor trends in the
  abundance of dolphins in the eastern tropical Pacific (ETP) . The Southwest Fisheries
  Science Center (SWFSC) has been conducting a variety of marine mammal surveys in
  the ETP and other areas of the Pacific Ocean. The purpose of these surveys has been
  to estimate the population sizes of cetacean species and monitor the impact of the
  commercial fisheries which incidentally kill dolphins. The 1992 survey was designed
  to make abundance estimates of the central stock of common dolphin, Delphinus delphis.
  This stock of dolphin is taken in the tropical tuna fishery and suffered a substantial
  decline (Anganuzzi et al. 1992).  Previous surveys covering larger areas have permitted
  estimates of abundance, but with low precision (Wade and Gerrodette 1993).  The
  1992 survey was conducted by the NOAA Ships McArthur and David Starr Jordan.\",\n\t\"license_title\":
